f32 func0f066a1c(struct modelrodata_bbox *bbox, f32 arg1, f32 arg2, f32 arg3)
{
	f32 sum = 0;

	if (arg1 >= 0) {
		sum += bbox->xmin * arg1;
	} else {
		sum += bbox->xmax * arg1;
	}

	if (arg2 >= 0) {
		sum += bbox->ymin * arg2;
	} else {
		sum += bbox->ymax * arg2;
	}

	if (arg3 >= 0) {
		sum += bbox->zmin * arg3;
	} else {
		sum += bbox->zmax * arg3;
	}

	return sum;
}

